PIC_SIZE = 25*6
p IMAGE_DATA.count / PIC_SIZE
class Layer
  attr_accessor :data
  def initialize(data)
    @data = data
  end

  def count(n)
    sum = 0
    data.each do |pixel|
      sum += 1 if pixel == n
    end
    sum
  end

  def pos(n)
    @data[n]
  end
end

class Image
  attr_accessor :layers, :pixels
  def initialize
    @layers = []
    @pixels = []
    @height = 6
    @width = 25
  end

  def split_data_to_layers(image_data)
    n = 1
    while image_data[(n - 1)*PIC_SIZE] != nil
      layer = Layer.new(image_data[(n-1) * PIC_SIZE...(n * PIC_SIZE)])
      @layers << layer
      n += 1
    end
  end

  def find_lowest_zero_layer
    final_layer = @layers.first
    @layers.each do |layer|
      num = layer.count(0)
      final_layer = layer if num < final_layer.count(0)
    end
    final_layer
  end

  def draw
    pos = 0
    while pos < PIC_SIZE
      current_layer = 0
      while @layers[current_layer]&.pos(pos) == 2
        current_layer += 1
      end
      pixel = @layers[current_layer]&.pos(pos)
      @pixels << (pixel.nil? ? 2 : pixel)
      pos += 1
    end
  end

  def show
    @pixels.each_with_index do |pixel, i|
      print pixel
      print " "
      print "\n" if (i + 1) % @width == 0
    end
  end

  def dig_at_pos(pos)
    @layers.each do |layer|
      p layer.pos(pos)
    end
  end
end

image = Image.new
image.split_data_to_layers(IMAGE_DATA)
image.draw
p image.pixels











